import React, { Component } from 'react'


class List extends Component{

    showTodos(todos){
      return(
        todos.map((todo) => {
          return(
            <div className="todo">{todo.titre} </div>
          )
        })
      )
    }

    render(){
      return(
        <div className="liste">
          Todos: [{this.props.todos.length}]
          { this.showTodos(this.props.todos)}
          </div>
      );
    }
  }

  export default List;
